  return (
    <div className="App">
      <h1>Hello World</h1>
        <Routes>
            <Route path='/' element={<Inicio></Inicio>}></Route>
            <Route path='/pokemon/:id' element={<Pokemon></Pokemon>}></Route>
        </Routes>


    </div>
  );
}

export default App;
